import React from 'react';
import logo from '../styles/Logo.module.css';

const Logo = () => {
  return (
    <div>
      <svg className={logo.circle} xmlns="http://www.w3.org/2000/svg" width="100" height="100" viewBox="0 0 100 100">
        <defs>
          <linearGradient id="gradient" x1="0%" y1="0%" x2="0%" y2="100%">
            <stop offset="0%" stop-color="#ec5200" />
            <stop offset="100%" stop-color="transparent" />
          </linearGradient>
        </defs>
        <circle cx="40" cy="40" r="20" stroke="url(#gradient)" stroke-width="6" fill="none" transform='rotate(90 50 50)' />
      </svg>
      <span>Circle</span>
    </div>
  )
}

export default Logo;
